import React from "react";

const Card = ({ data }) => {
  console.log(data);

  return (
    <div className="cardContainer">
      {data.map((curItem, index) => {
        return (
          <div className="card">
            <img />
            <div className="cardContent"> </div>
          </div>
        );
      })}
    </div>
  );
};

export default Card;
